class ModelLevel{
	fiendModelList=[];
	LevelId=0;
	MoveX=300;
	constructor(fiendModelList,LevelId,MoveX)
	{
		this.fiendModelList = fiendModelList;
		this.LevelId = LevelId;
		this.MoveX = MoveX;
	}
}
export { ModelLevel }
